import React, { useEffect, useState } from 'react';
import { getWisata, deleteWisata } from '../../api';
import { useNavigate } from 'react-router-dom';

const ManajemenWisata = () => {
    const [wisataList, setWisataList] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        loadData();
    }, []);

    const loadData = () => {
        getWisata().then(data => setWisataList(data));
    };

    const handleDelete = (id) => {
        if (window.confirm('Yakin ingin menghapus wisata ini?')) {
            deleteWisata(id).then(() => loadData());
        }
    };

    return (
        <div className="manajemen-wisata">
            <h2>Manajemen Wisata</h2>
            <button onClick={() => navigate('/admin/tambah-wisata')}>Tambah Wisata</button>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Nama</th>
                        <th>Aksi</th>
                    </tr>
                </thead>
                <tbody>
                    {wisataList.map(wisata => (
                        <tr key={wisata.id}>
                            <td>{wisata.id}</td>
                            <td>{wisata.nama}</td>
                            <td>
                                <button onClick={() => navigate(`/admin/edit-wisata/${wisata.id}`)}>Edit</button>
                                <button onClick={() => handleDelete(wisata.id)}>Hapus</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default ManajemenWisata;
